package com.roy.maintest;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

import org.apache.commons.codec.binary.Base64;

import lombok.extern.slf4j.Slf4j;

/**
 * @author guojun
 * @date 2022/7/12 11:36
 */
@Slf4j
public class TestSiminar {

  public static class ConvertUtils {

    /**
     * byte[]转float[]
     * @param data byte[]
     * @return
     */
    public static float[] byteArrayToFloatArray(byte[] data) {

      float[] result = new float[data.length / 4];
      for (int i = 0; i < data.length; i += 4) {
        int temp = 0;
        temp = temp | (data[i] & 0xff);
        temp = temp | (data[i + 1] & 0xff) << 8;
        temp = temp | (data[i + 2] & 0xff) << 16;
        temp = temp | (data[i + 3] & 0xff) << 24;
        result[i / 4] = Float.intBitsToFloat(temp);
      }
      return result;
    }

    public static List<Double> floatArrayToDoubleList(float[] data) {
      List<Double> ret = new ArrayList<>();
      for (float v : data) {
        ret.add(Double.valueOf(v));
      }
      return ret;
    }
  }

    /**
     * byte[]转float[]
     * @param data byte[]
     * @return
     */
    public static float[] byteArrayToFloatArray(byte[] data) {

      float[] result = new float[data.length / 4];
      for (int i = 0; i < data.length; i += 4) {
        int temp = 0;
        temp = temp | (data[i] & 0xff);
        temp = temp | (data[i + 1] & 0xff) << 8;
        temp = temp | (data[i + 2] & 0xff) << 16;
        temp = temp | (data[i + 3] & 0xff) << 24;
        result[i / 4] = Float.intBitsToFloat(temp);
      }
      return result;
    }


  public static class SimilarityUtil {

    public static double similarity(List<Double> va, List<Double> vb) {
      if (va.size() > vb.size()) {
        int temp = va.size() - vb.size();
        for (int i = 0; i < temp; i++) {
          vb.add(0d);
        }
      } else if (va.size() < vb.size()) {
        int temp = vb.size() - va.size();
        for (int i = 0; i < temp; i++) {
          va.add(0d);
        }
      }

      int size = va.size();
      double simVal = 0;


      double num = 0;
      double den = 1;
      double powa_sum = 0;
      double powb_sum = 0;
      for (int i = 0; i < size; i++) {
        double a = Double.parseDouble(va.get(i).toString());
        double b = Double.parseDouble(vb.get(i).toString());

        num = num + a * b;
        powa_sum = powa_sum + (double) Math.pow(a, 2);
        powb_sum = powb_sum + (double) Math.pow(b, 2);
      }
      double sqrta = (double) Math.sqrt(powa_sum);
      double sqrtb = (double) Math.sqrt(powb_sum);
      den = sqrta * sqrtb;

      simVal = num / den;

      return simVal;
    }
  }

  public static void main(String[] args) {
    byte[] bytes1 = Base64.decodeBase64(
        "");
    float[] c1bytes = ConvertUtils.byteArrayToFloatArray(bytes1);

    byte[] bytes2 = Base64.decodeBase64(
        "");
    float[] c2bytes = ConvertUtils.byteArrayToFloatArray(bytes2);

    log.info("{}",SimilarityUtil.similarity(Arrays.asList(-0.4,0.8,0.5,-0.2,0.3), Arrays.asList(-0.5,0.4,0.2,0.7,0.1)));
    log.info("{}",SimilarityUtil.similarity(ConvertUtils.floatArrayToDoubleList(c1bytes), ConvertUtils.floatArrayToDoubleList(c2bytes)));

  }
}
